import {  useSelector } from 'react-redux'
import { useState } from "react";
import createProject from '../services/createProject';

function AdminNewProject() {
  
    const [title, setTitle] = useState("");
    const [description, setDescription] = useState("");
    const [coverImg, setCoverImg] = useState("");
  
    const token = useSelector((state) => state.admin);
    const projectInfo = {}

    async function sendProject() {
      try {
        createProject(token, projectInfo)
      } catch (error) {
        alert(error.message)
      }

    }
  
    return (
      <main>
        <section>
          <h1>New Project</h1>
          <form onSubmit={(e) => e.preventDefault()}>
            <div className="input-wrapper">
              <label htmlFor="title">Project Title</label>
              <input type="text" id="title" value={title}
                     onChange={(event) => setTitle(event.target.value)} />
            </div>

            <div className="input-wrapper">
              <label htmlFor="description">Project description</label>
              <input type="text" id="description" value={description}
                     onChange={(event) => setDescription(event.target.value)} />
            </div>

            <div className="input-wrapper">
              <label htmlFor="coverImg">Cover Image</label>
              <input type="file" id="coverImg" value={coverImg}
                     onChange={(event) => setCoverImg(event.target.value)} />
            </div>
  
            <button className="btn-primary" onClick={() => sendProject()}>Send</button>
          </form>
        </section>
      </main>
    );
  }
  
  export default AdminNewProject;
